import Nav from "./component/Nav";
import './App.css'
import Sidebar from "./component/Sidebar";
import Middlebar from "./component/Middlebar";
import Feeds from "./component/Feeds";
function App() {
  return (
<>
<Nav/>
<div className="row">
  <div className="col lineright" style={{width:"5%",minHeight}}><Sidebar/></div>
  <div className="col" style={{width:"25%"}}><Middlebar/></div>
  <div className="col" style={{width:"70%"}}><Feeds/></div>
</div>

</>
  );
}

export default App;
